import React from 'react';
import './App.css';
import Banner from './Banner';
import Conteudo from './Conteudo';
import Rodape from './rodape';


function App() {
  return (
    <div>
        <Banner/>
            <Conteudo/>
            <Rodape/>
    </div>
    
  );
}

export default App;
